■お取り寄せの為、ご注文を頂いた時点で完売となっている可能性がございます。  その場合はご連絡させて頂きますので予めご了承ください<br><table width="300" border="0" cellspacing="0" cellpadding="0"><tr><td><font color="#333333" size="-1">秋に種を蒔き、初冬に芽を出す大麦は、春の兆しが見え始めた頃には畑一面を生命力溢れる青々とした若葉で覆います。大麦の若葉には、カルシウムやカリウム、食物繊維などが含まれています。日常の食生活の補助として、不足しがちな栄養補給におすすめします。</font></td></tr></table><br><table width="300" border="0" cellpadding="5" cellspacing="1" bgcolor="#666666"><tr bgcolor="#FFFFFF"><td width="25%" align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">内容量</font></td><td width="75%" align="left"><font color="#333333" size="-1">150g(3g×50包)</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">サイズ</font></td><td align="left"><font color="#333333" size="-1">個装サイズ：15×11×12cm</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">重量</font></td><td align="left"><font color="#333333" size="-1">個装重量：249g</font></td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">仕様</font></td><td align="left"><font color="#333333" size="-1">商品区分：健康食品</font><br><font color="#333333" size="-1">名称：大麦若葉加工食品</font><br><font color="#333333" size="-1">賞味期間：製造日より1,260日</font><br> </td></tr><tr bgcolor="#FFFFFF"><td align="center" nowrap bgcolor="#FFFFCC"><font color="#333333" size="-1">製造国</font></td><td align="left"><font color="#333333" size="-1">日本</font></td></tr></table><!--ab--><!--ab2015.6-->・広告文責(株式会社創和　0299-47-0506)<style type="text/css">
